import React, { useState } from 'react';
import HomeDashboard from './components/HomeDashboard';
import NutritionPlan from './components/NutritionPlan';

function App() {
  const [currentView, setCurrentView] = useState<'home' | 'nutrition'>('home');

  const handleNavigateToNutrition = () => {
    setCurrentView('nutrition');
  };

  const handleNavigateToHome = () => {
    setCurrentView('home');
  };

  return (
    <div className="App min-h-screen bg-gray-50">
      {currentView === 'home' && (
        <HomeDashboard onNavigateToNutrition={handleNavigateToNutrition} />
      )}
      {currentView === 'nutrition' && (
        <NutritionPlan onBack={handleNavigateToHome} />
      )}
    </div>
  );
}

export default App;
